contracts/11_Ejecicio_Herencia.sol.content:
// SPDX-License-Identifier: GPL-3.0

pragma solidity >=0.7.0 <0.9.0;

contract Participante {

    string _nombre;
    string _apellido;

    constructor(string memory nombre, string memory apellido) {
        _nombre = nombre;
        _apellido = apellido;
    }

    
    function saludo() public view returns (string memory){
        return ((string) (abi.encodePacked("Hola ", _nombre, " ", _apellido)));
    }
}

contract Alumno is Participante {
    constructor(string memory nombre, string memory apellido) Participante (nombre, apellido) {}
}

contract Docente is Participante {
    constructor(string memory nombre, string memory apellido) Participante (nombre, apellido) {}
}

